import React from 'react';

const PromotionCard = ({ promotion }) => (
  <div>
    <img src={promotion.imageUrl} />
    <div>
      <h1>{promotion.title}</h1>
      <span>{promotion.price}</span>
      <footer>
        {promotion.comments.lenght > 0}
      </footer>
    </div>
  </div>
)

export default PromotionCard;
